import React from 'react'
import { useSelector } from 'react-redux'

export function ChatHeader({ roomId }) {
    room = useSelector(state => state.rooms.rooms.find(room.id === roomId))

    return (
        <div className="">
            {room.name}
        </div>
    )
}
